import React from 'react';
import {Navbar,NavbarBrand,Nav,NavItem,NavLink,Img,Collapse,NavbarToggler} from 'reactstrap'
class Navegacion extends React.Component{
    render(){
        return(
            <Navbar color="light" light expand="md">
                <img src="https://i.ibb.co/WHqZFx1/store-icon-icons-com-54371.png"></img>
                <NavbarBrand href="/">{this.props.NombreTienda}</NavbarBrand>
                    <NavbarToggler/>
                    <Collapse navbar>
                        
                        <Nav className="ml-auto" navbar>
                            <NavItem>
                            <NavLink href="/components/">Inicio</NavLink>
                            </NavItem>
                            <NavItem>
                            <NavLink href="/components/">Productos</NavLink>
                            </NavItem>
                            <NavItem>
                            <NavLink href="/">Contacto</NavLink>
                            </NavItem>

                    
                        </Nav>
                       
                     </Collapse>
            </Navbar>
        );
    }
}

export default Navegacion;
